modeBarButtonsToAdd.click:
function(gd) { 
        // is this being viewed in RStudio?
        if (location.search == '?viewer_pane=1') {
          alert('To learn about plotly for collaboration, visit:\n https://cpsievert.github.io/plotly_book/plot-ly-for-collaboration.html');
        } else {
          window.open('https://cpsievert.github.io/plotly_book/plot-ly-for-collaboration.html', '_blank');
        }
      }

ajax.data:
function(d) {
d.search.caseInsensitive = true;
d.search.smart = true;
d.escape = true;
var encodeAmp = function(x) { x.value = x.value.replace(/&/g, "%26"); }
encodeAmp(d.search);
$.each(d.columns, function(i, v) {encodeAmp(v.search);});
}

